import axios from 'axios';

const USERS_REST_API_URL = 'http://localhost:8080/api/v1';

class UserService {

    getUsers(){
        return axios.get(USERS_REST_API_URL);
    }

    postUser = async() => {
        let res = await axios.post(USERS_REST_API_URL, {"id": 3,"firstName":"Stas","lastName":"Stankevich","email":"stas@gmail.com"});
        console.log(res);
    }

}

export default new UserService();
